import image from './2023.png';
import './home.css';
import img from './img_shop.jpg';
function Home(){
    return (
        <>
        <div className='home-box'>
            <div className='about'>
                <h1>Hii .... I Am<br/> Anuj Singh Rana </h1>
                <h2> A Web Devloper</h2>
                <img className='img' src={img}/>
            </div>
        </div>
        </>
    );
}
export default Home;
